	add("insect", "{\"term\":\"insect\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"{{PIE root|en|sek}}From Middle french (ca. 1400-1600) \u0027insecte\u0027 from Latin \u0027insectum\u0027 (with a notched or divided body, cut up) from perfect passive participle of {{m|la|insecō||I cut up}}, from \u0027in-\u0027 () + {{m|la|secō||I cut}}, from the notion that the insect\u0027s body is \u0026quot;cut into\u0026quot; three sections. Calque of Ancient Greek \u0027ἔντομον\u0027 (insect) from \u0027ἔντομος\u0027 (cut into pieces)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An arthropod in the class Insecta, characterized by six legs, up to four wings, and a chitinous exoskeleton\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dNonetheless, some \u0027\u0027insect\u0027\u0027 prey take advantage of clutter by hiding in it. Earless ghost swift moths become “invisible” to echolocating bats by forming mating clusters close (less than half a meter) above vegetation and effectively blending into the clutter of echoes that the bat receives from the leaves and stems around them\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any small arthropod similar to an insect including spiders, centipedes, millipedes, et\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A contemptible or powerless person\", \"priority\":4}]}, \"synonyms\":{}}");

