	add("inside", "{\"term\":\"inside\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The interior or inner or lesser part\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Looked he o\u0027 the \u0027\u0027inside\u0027\u0027 of the paper\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dThen he commenced to talk, really talk. and \u0027\u0027inside\u0027\u0027 of two flaps of a herring\u0027s fin he had me mesmerized, like Eben Holt\u0027s boy at the town hall show. He talked about the ills of humanity, and the glories of health and Nature and service and land knows what all\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The side of a curved road, racetrack etc. that has the shorter arc length; the side of a racetrack nearer the interior of the course or some other point of reference\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The interior organs of the body, especially the guts\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A passenger within a coach or carriage, as distinguished from one upon the outside\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Anti-Jacobin\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"So down thy hill, romantic Ashbourne, glides / The Derby dilly, carrying three \u0027\u0027insides\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"So, what between Mr. Dowler\u0027s stories, and Mrs. Dowler\u0027s charms, and Mr. Pickwick\u0027s good humour, and Mr. Winkle\u0027s good listening, the \u0027\u0027insides\u0027\u0027 contrived to be very companionable all the way\", \"priority\":9}]}, \"synonyms\":{}}");

	add("insider", "{\"term\":\"insider\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|inside|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who has special knowledge about the inner workings of a group, organization, or institution\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1923\u0027\u0027, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,716015,00.html ‘Big Board’ Failures],\u0026quot; \u0027Time\u0027, 2 Jul\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Heavy losses were sustained in Simms Petroleum, which took a greater toll from supposed \u0026quot;Wall Street \u0027\u0027insiders\u0027\u0027\u0026quot; than from the general public\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Jonathan Clayton, \u0026quot;[http://www.timesonline.co.uk/tol/news/world/africa/article3070220.ece Profile: Zuma charmed wives and a nation],\u0026quot; \u0027Times of London\u0027 (UK), 19 Dec\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He is also an astute ANC \u0027\u0027insider\u0027\u0027 who spent ten years on Robben Island alongside Nelson Mandela and the other “grandees” of the movement\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person who is within an enclosed space\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1849\u0027\u0027, \u0027Redburn: His First Voyage\u0027, ch. 33\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"To the \u0027\u0027insider\u0027\u0027, the ceiling is like a small firmament twinkling with astral radiations\", \"priority\":8}]}, \"synonyms\":{}}");

