	add("inspection", "{\"term\":\"inspection\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) from Old french (842-ca. 1400) \u0027inspeccion\u0027 from Latin {{m|la|inspectiō||examination, inspection}}, from the verb {{m|la|inspectō||I inspect}}, from {{m|la|spectō||I observe, I watch}}, frequentive of {{m|la|speciō||I look at}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Act of examining something, often closely\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Upon closer inspection, the animal turned out to be a dolphin, not a shark\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Organization that checks that certain laws or rules are obeyed\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The inspection fined the restaurant\u0027s owner because the kitchen was dirty\", \"priority\":4}]}, \"synonyms\":{}}");

	add("inspector", "{\"term\":\"inspector\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Latin \u0027in-\u0027 + spectare|spectāre, to look.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person employed to inspect something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d6|page\u003d30|magazine\u003d|title\u003d[http://www.theguardian.com/education/2013/jul/01/education-michael-gove-finland-gcse Finland spreads word on passage\u003dImagine a country where children do nothing but play until they start compulsory schooling at age seven. Then, without exception, they attend comprehensives until the age of 16.There are no \u0027\u0027inspectors\u0027\u0027, no exams until the age of 18, no school league tables, no private tuition industry, no school uniforms\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A police officer ranking below superintendent\", \"priority\":3}]}, \"synonyms\":{}}");

